import React from "react";
import MiniView from "./MiniView";
const ProjectSpread = (props) => {
  let { projects, active } = props;
  let projectMiniView = projects.map((project) => 
    <MiniView name={project.name} />
  );
  return <div></div>;
};

export default ProjectSpread;
